import React from 'react';


const FlightCards = (links, mission_name, launch_year, launch_success, rocket, mission_id) => {
    return (<div className="grid-item">
        <div className="content">
            <img src={links.mission_patch_small} alt="mission_name" />
            <h2>{mission_name}</h2>
            <h6>Mission Ids: {mission_id}</h6>
            <h6>Launch Year: {launch_year}</h6>
            <h6>successful Launch: {launch_success ? 'Yes' : 'No'}</h6>
            {/* <h6>successful Landing: {rocket.first_stage.cores[0].land_success ? 'Yes' : 'No'}</h6> */}
        </div>
    </div>)
}

export default FlightCards;
